import React from 'react';

const Todo = (props) => {
  return (
    <div className="card card-custom">
      <div className="card-body">
        <span className="card-text">{props.todo.todo}</span>
        <button className="btn btn-primary delButton">Delete</button>
      </div>
    </div>
  );
};

export default Todo;
